import React from 'react';

function counter() {
    return ( 
        <div className='card'>
            <div className='card bg-secondary'>
                <h2>My counter App</h2>
            </div>
            <div className='card-body'>
                <p>My card body</p>
            </div>
        </div>
     );
}

export default counter;
